CREATE TABLE IF NOT EXISTS job_test (
    `Job_Name` VARCHAR(41) CHARACTER SET utf8,
    `Hotness_Level` VARCHAR(2) CHARACTER SET utf8,
    `Skills_Required` VARCHAR(19) CHARACTER SET utf8,
    `Interests` VARCHAR(17) CHARACTER SET utf8,
    `Education` VARCHAR(18) CHARACTER SET utf8,
    `Degree` VARCHAR(36) CHARACTER SET utf8,
    `Work_Experience` VARCHAR(23) CHARACTER SET utf8,
    `years_to_be_employed` INT,
    `Schools` VARCHAR(37) CHARACTER SET utf8,
    `Companies` VARCHAR(20) CHARACTER SET utf8
);
